import React from 'react'
import { List } from 'antd';
import PresentationItem from './presentationItem';

export default class ArticleList extends React.Component {
  render() {
    var list = [];
    const presentation = this.props.presentation;
    if(presentation!='null'){
        list = eval(presentation).map(item => <PresentationItem key={item.name} name={item.name} description={item.description} time={item.time} url={item.url}/>);
    }
    return (
      <div className="archive-list">
         <div className="archive-list-area">
          <div className="archive-itemlist">
            <List
              itemLayout="horizontal"
              dataSource={eval(presentation)}
              renderItem={item => (
                <List.Item>
                  <List.Item.Meta
                    title={<a href={this.item.url}>{this.item.name}</a>}
                    description={this.item.description}
                  />
                </List.Item>
              )}
          />
          </div>
        </div>
      </div>
    );
  }
}
